import React from 'react';
import Button from '@material-ui/core/Button';
import { Link } from 'react-router-dom';
import RedCarpet from './assets/oscar-red-carpet.png';

const Landing = () => {
    return (
        <div style={{ backgroundColor: "salmon", height: "100vh", position: "relative" }}>
            <div style={{ backgroundColor: "skyblue", height: "75vh", width: "50vw", left: "0", position: "absolute" }} >
                Right top
            </div>
            <div style={{ backgroundColor: "olive", height: "75vh", width: "50vw", right: "0", position: "absolute" }}>
                Left Top
                <Link to="/nomination">
                    <Button>
                        Get Started
                </Button>
                </Link>
            </div>
            Bottom
            <div style={{ backgroundColor: "rgba(0,0,0,0)", width: "80vw", height: "auto", left: "0", bottom: "0", position: "absolute" }}>
                <img width="100%" height="100%" alt="Oscar welcome image" src={RedCarpet} />
            </div >
        </div>
    );
};

export default Landing;
